import React, { Component } from 'react'

const cameraVid = require('./carsTest.mp4')

class CameraLayout extends Component {
    render(){
    return(
    <div>
        <h1>Camera Layout</h1>
        <div>
            <video src={cameraVid} autoPlay></video>
        </div>
    </div>
    )}
}

export default CameraLayout
